Happy New Year!! Just got the most Exciting News!! Our Hit single "Place in the Sun " Pretty Poison-Jade Starling feat Lee Dagger @tazmaniarecords is #1 for the 2nd week in a row on New Music Weekly Top 40 Indie Singles Chart  #7 on the Top 40 Radio Chart and #17 on the Top 100 Chart!! What a Perfect way to end the year on a High Note and go out On Top!! Our Official Music Video is now over 100K Views!! Teamwork makes the Dreamwork and our Amazing Team has made all my Dreams come true in 2023!! Thanks so much for 2 Number ones this year also with "Crazy "!! Special Heartfelt Thanks to @henryvargasmusic @danmathews_klubjumpers @sam_klubjumpers @newmusicweeklymagazine @ferullomike Without you none of this would be possible!! Special Thanks to all the DJs,,Radio Stations,Mixshows Iheartradio, Musicworx for playing our music all over the world!! Gratitude and much appreciation to the phenomenal producers for working your magic @blockandcrownofficial C-Dub, Joe Gillan E-39 @realstonebridge @darkintensity @djkue @dastudio_x15 @pattiandrews3 Francesco MrMind De Simone @ron_geffen
@larry_peace_music @lucadebonaireofficial @dan.boots @suraci_nyc @raphvalentino Special Thanks to all the Fans, Friends and Family for your Continued Love and Support!! Wishing you all a Happy ,Healthy and Prosperous New Year !! Never Give Up On Your Dreams!! Love and Blessings in 2024!! New Music Coming Soon!! Love You Guys!! #tour #iheartradio #radio #dj #beatport #itunes #luv #instalove #insta #instame #instagood #instadaily #instagrammer #instagram #instalikes #photooftheday #instagramhub #instagramer #Musicworx #instafashion #instafamous #instapic #instamoment #instamusic #instagoodmyphoto  #muscle #instago Xoxo ♥️😘💋

